import '../css/style.scss';
import Navigation from '../component/Navigation';

import ServiceBackground from '../../../shared/images/service/service-background.png'

const Service = () => {
  return (
    <div className="elysia">
      <section className="main" style={{ backgroundImage: `url(${ServiceBackground})` }}>
        <Navigation />
        <div className="main__content-container">
          <h1 className="main__content--bold">
            <span className="main__content--blue">ELYFI</span> : <br />Real asset liquidity protocol
          </h1>
          <p className="main__content">
            ELYFI is an open source and non-custodial liquidity protocol<br />for earning interest on deposits and borrowing assets.
          </p>
        </div>
      </section>
    </div>
  );
}

export default Service;
